import React from 'react'
import AboutImg from "../assets/3.jpg"

const Contact = () => {
  return (
    <>
    <Navbar/>
    <Hero
       cName="hero-mid"
       heroimage={AboutImg}
       title="Services"
    />
    </>
  )
}

export default Contact
